import React from 'react';
import './App.css';
import {UserInput} from './UserInput/UserInput.js'
import {UserOutput} from './UserOutput/UserOutput.js'


class App extends React.Component{
    state = {
      username: "weijun"
    }

    render() {
      return (
        <div>
          <UserInput />
          <UserOutput username = {this.state.username} />
        </div>
      )
    }
}


export default App
